            font-size: 36px;
            padding: 20px;
        }

        .segment .content {
            font-size: 30px;
        }

        .img img {
            width: 250px;
        }

        a, a:link {
            color: #4183C4;
            font-weight: bold;
            text-decoration: none;
        }
    </style>
</head>
<body>
<div class="flex-center position-ref full-height">
    <div class="segment">
        <div class="img">
            <a href="{{ url('/') }}">
                <img src="data:image/jpeg;base64,">
            </a>
        </div>
        <div class="title">{{ $message }} </div>
    </div>
</div>
